import React, { Component } from "react";
import { Redirect } from 'react-router-dom';

class FormDetail extends Component {

    state = {
        form:{}
    }

    componentDidMount() {
        if(this.props.location.state){
            this.setState({
                form:this.props.location.state
            })

        }
    }

    render() {
        console.log(this.state)
        return (
            <React.Fragment>
                <form className="mt-3">
                    <div className="form-group row">
                        <label htmlFor="formName" className="col-sm-2 col-form-label">Form Name</label>
                        <div className="col-sm-10">
                            <input name="formName" className="form-control" type="text" placeholder="Default input" />
                        </div>
                    </div>
                    <div className="form-group row">
                        <label htmlFor="formName" className="col-sm-2 col-form-label">Form Description</label>
                        <div className="col-sm-10">
                            <textarea className="form-control" aria-label="With textarea"></textarea>
                        </div>
                    </div>
                    <div className="form-group row">
                        <label htmlFor="formName" className="col-sm-2 col-form-label">Created At</label>
                        <div className="col-sm-10">
                            <input readOnly name="formName" className="form-control" type="text" placeholder="Default input" />
                        </div>
                    </div>
                    <div className="form-group row">
                        <label htmlFor="formName" className="col-sm-2 col-form-label">Name</label>
                        <div className="col-sm-10">
                            <input  name="formName" className="form-control" type="text" placeholder="Default input" />
                        </div>
                    </div>
                    <div className="form-group row">
                        <label htmlFor="formName" className="col-sm-2 col-form-label">Surname</label>
                        <div className="col-sm-10">
                            <input  name="formName" className="form-control" type="text" placeholder="Default input" />
                        </div>
                    </div>
                    <div className="form-group row">
                        <label htmlFor="formName" className="col-sm-2 col-form-label">Age</label>
                        <div className="col-sm-10">
                            <input  name="formName" className="form-control" type="text" placeholder="Default input" />
                        </div>
                    </div>


                </form>
            </React.Fragment>
        )
    }

}


export default FormDetail;
